Makai Senki Disgaea or Netherworld Battle Chronicle Disgaea, is an anime based on the video game Disgaea: Hour of Darkness. Makai Senki Disgaea follows the same general plot as the game, although some roles and the timing of events have been altered. New merchandise for the anime is also being produced. The anime is licensed by Geneon with NISA in the United States.This show is made by the director of Shugo Chara! and Shugo Chara!Doki!

